title: 'Filing Metal Edges'
date: '2020-01-14'
excerpt: "After sawing out a design on metal sheet, the edges are left rough..."
thumbnail: "/Lyssis-Designs/Images/Jewellery/NeedleFilesRotated.jpg"
thumbnailPosition: "top"
